import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import HomePage from './pages/HomePage';
import SecondPage from './pages/SecondPage';
import StacksPage from './pages/StacksPage';
import StackDetailsPage from './pages/StackDetailsPage';
import BuildStackPage from './pages/BuildStackPage';
import RunStackPage from './pages/RunStackPage';
import './App.css';

const App = () => (
    <Router>
        <div className="App">
            <Switch>
                <Route exact path="/" component={HomePage} />
                <Route path="/second-page" component={SecondPage} />
                <Route path="/stacks" component={StacksPage} />
                <Route path="/stacks/:id" exact component={StackDetailsPage} />
                <Route path="/stacks/:id/build" component={BuildStackPage} />
                <Route path="/stacks/:id/run" component={RunStackPage} />
            </Switch>
        </div>
    </Router>
);

export default App;
